import React from "react";
import Card from "./Card";
import Button from "./Button";
import './Error.css';
const Error = (props) =>{
    return(
        <>
        <Card>
        <header className="header">
            <h2>{props.title}</h2>
        </header>

        <div className="content">
            <p>{props.message}</p>
        </div>

        <footer className="actions">
            <Button>Okay</Button>
        </footer>

        </Card>
        </>
    )
}

export default Error;
